import {DATA_FIELD, ORDER_DIRECTION, ORDER_FIELD} from '../enums/data.enum';
import {OperatorType} from '../types/operators.type';
import {SkillEntity} from '../models/skill-entity.model';
import {ProjectEntity} from '../models/project-entity.model';


/**
 * @interface QueryFilterInterface
 * @description Query interface for filtering entities.
 */
export interface QueryFilterInterface {
  /**
   * Name of the field to be filtered.
   */
  name: DATA_FIELD,

  /**
   * Operator to be used to filter the field.
   */
  operator?: OperatorType,

  /**
   * Condition to be used to filter the field.
   * Default is 'AND'.
   */
  condition?: 'AND' | 'OR',

  /**
   * Value to be used to filter the field.
   */
  value: string | number | boolean | Date | SkillEntity | ProjectEntity,
}

/**
 * @interface OrderByInterface
 * @description Interface to be used to order the data.
 */
export interface OrderByInterface {
  /**
   * Name of the field to be ordered.
   */
  name: ORDER_FIELD,
  /**
   * Order to be used to order the field.
   */
  direction?: ORDER_DIRECTION,
}


/**
 * @interface QueryInterface
 * @description Query interface for
 *  filtering
 *  ordering
 *  limit
 *  offset
 *  or search entities.
 */
export interface QueryInterface {
  /**
   * Filters to be applied to the data.
   */
  filters?: QueryFilterInterface[],

  /**
   * Order to be applied to the data.
   */
  orderBy?: OrderByInterface[],

  /**
   * Limit to be applied to the data.
   */
  limit?: number,

  /**
   * Offset to be applied to the data.
   */
  offset?: number,

  /**
   * Search to be applied to the data.
   */
  search?: string,

}

import {iDrawCircle} from "../../../shared/draw-circle/draw-circle.interface";
import {iCircleMenuItem} from "../circle-menu-item/circle-menu-item.interface";

/**
 * Interface of a profile menu item data.
 * Used by ProfileMenuItem Model.
 * @see ProfileMenuItem
 */
export interface ProfileMenuItemData {
  /**
   * Importance of the menu item will be used
   * to calculate the arc degree size of the menu item
   * and the drawn circle between all other menu items.
   */
  importance: number;
  /**
   * Offset for making the importance
   * of the drawn circle bigger or smaller.
   *
   * Changing this will automatically change
   * the next item's offset by adding the missing offset
   * or subtracting the exceeding offset.
   *
   * Unit is in degree, so be carefully with the value you set,
   * or it may break the menu. Recommended value is between -30 and 30.
   *
   * Also notice that the menu will be drawn in a counterclockwise direction.
   */
  offset?: number;
  circleMenuItem: iCircleMenuItem;
  drawCircleItem: iDrawCircle;
  routerLink?: string;
}

