@use 'mixins';
@use 'functions' as fn;

:host {
  pointer-events: none;
}
.cv-tooltip-component {
  pointer-events: none;
  height: 30px;
  width: 50px;
  position: relative;
  .line {
    @include mixins.transition();
    stroke-width: 1px;
    stroke: var(--tooltip-stroke-color);
    stroke-dashoffset: 100;
    stroke-dasharray: 100;
  }

  .cv-tooltip {
    &__container {
      @include mixins.transition($property: opacity);
      position: absolute;
      background: fn.get-color(accent, 500, .9);
      filter: drop-shadow(0 2px 10px #{fn.get-color(accent, 900)});
      min-width: 150px;
      min-height: 50px;
      width: fit-content;
      padding: 10px;
      opacity: 0;
      animation-timing-function: cubic-bezier(.28,0,0,1);
      //animation-fill-mode: both;
      animation-direction: normal;
      animation-duration: 0.2s;
      clip-path: polygon(
          0 0,
          80px 0%,
          85px 5px,
          calc(100% - 10px) 5px,
          100% 16px,
          100% 100%,
          87px 100%,
          82px calc(100% - 5px),
          10px calc(100% - 5px),
          0 calc(100% - 15px),
      );

      @at-root .top-left#{&} {
        bottom: calc(100% - 25px);
        right: 100%;
        animation-name: disappear-right;
      }
      @at-root .left#{&} {
        bottom: calc(50% - 25px);
        right: 100%;
      }
      @at-root .bottom-left#{&} {
        top: calc(100% - 25px);
        right: 100%;
      }

      @at-root .top#{&} {
        bottom: 100%;
        left: calc(-50% - 50px);
        margin-bottom: -5px;
        animation-name: disappear-right;
      }

      @at-root .bottom#{&} {
        top: 100%;
        left: calc(-50% - 50px);
        animation-name: disappear-left;
      }

      @at-root .top-right#{&} {
        bottom: calc(100% - 25px);
        left: 100%;
        animation-name: disappear-left;
      }

      @at-root .right#{&} {
        bottom: calc(50% - 25px);
        left: 100%;
        animation-name: disappear-left;
      }

      @at-root .bottom-right#{&} {
        top: calc(100% - 25px);
        left: 100%;
        animation-name: disappear-left;
      }

    }
  }

  &.active {
    .line {
      @include mixins.transition($time: .6s, $delay: 0s);
      stroke-dashoffset: 0;
    }

    .cv-tooltip {
      &__container {
        @include mixins.transition($property: opacity);
        animation-play-state:  initial;
        animation-duration: 0.6s;
        opacity: 1;

        @at-root .top-left#{&} {animation-name: appear-right;}
        @at-root .left#{&} {animation-name: appear-right;}
        @at-root .bottom-left#{&} {animation-name: appear-right;}
        @at-root .top#{&} {animation-name: appear-right;}
        @at-root .bottom#{&} {animation-name: appear-left;}
        @at-root .top-right#{&} {animation-name: appear-left;}
        @at-root .right#{&} {animation-name: appear-left;}
        @at-root .bottom-right#{&} {animation-name: appear-left;}

      }
    }
  }
}

